package com.jty.model;import java.io.Serializable;import java.util.Date;import javax.persistence.Entity;import javax.persistence.Id;@SuppressWarnings("serial")@Entity(name = "funintegral")public class FunIntegral implements Serializable {    @Id	private Integer id;    private Integer userId;    private Float returnIntegral;    private Integer fromOrderId;    private Integer orderId;    private Float returnRatio;    private Date createTime;    private Float minusIntegral;    private Date minusTime;    private Integer isUsed;	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public Integer getUserId() {		return userId;	}	public void setUserId(Integer userId) {		this.userId = userId;	}	public Float getReturnIntegral() {		return returnIntegral;	}	public void setReturnIntegral(Float returnIntegral) {		this.returnIntegral = returnIntegral;	}	public Integer getFromOrderId() {		return fromOrderId;	}	public void setFromOrderId(Integer fromOrderId) {		this.fromOrderId = fromOrderId;	}	public Integer getOrderId() {		return orderId;	}	public void setOrderId(Integer orderId) {		this.orderId = orderId;	}	public Float getReturnRatio() {		return returnRatio;	}	public void setReturnRatio(Float returnRatio) {		this.returnRatio = returnRatio;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}	public Float getMinusIntegral() {		return minusIntegral;	}	public void setMinusIntegral(Float minusIntegral) {		this.minusIntegral = minusIntegral;	}	public Date getMinusTime() {		return minusTime;	}	public void setMinusTime(Date minusTime) {		this.minusTime = minusTime;	}	public Integer getIsUsed() {		return isUsed;	}	public void setIsUsed(Integer isUsed) {		this.isUsed = isUsed;	}	}